    fieldset {

        top: 10px;
        left: 10px;
        margin: 0;
        padding: 10px;
        background-color: #cfcfcf;

            0px 0px 3px 0px rgba(0, 0, 0, 0.29);
    }
    fieldset ::selection {
        text-shadow: none;
        background-color: #488ec7;
        color: #fff;

        font-size: 30px;
        line-height: 30px;

            0 0 0 rgba(5, 5, 5, 0.75),
            0 1px 2px #cfcfcf;

    }

        cursor: pointer;
    }
    fieldset input[type=submit] {
        box-sizing: border-box;
        width: 194px;
        height: 44px;
        border-radius: 4px;
        border: none;
        background-color: rgba(59, 136, 214, 1);
        color: rgba(255, 255, 255, 1);
        font-family: 'Open Sans', sans-serif;
        font-size: 26px;
        font-weight: 600;
        text-transform: uppercase;
        position: absolute;
        bottom: 32px;
        right: 11px;
        text-shadow: 0 -1px 0 rgba(0, 0, 0, 0.19);

<body>
    <form id="subscribe-form" method="POST" target="#">
        <a href="#" class="close-btn"></a>
        <fieldset>
            <h2><em>Subscribe</em> our <em>Newsletter</em></h2>
            <hr />
            <div class="input-group">
                <label for="email"  class="icon-email">&nbsp;</label>
                <input id="email" type="email" placeholder="enter your email address..." />
            </div>
            <p>Subscribe to our newsletter and get exclusive deals you wont find anywhere else straight to your inbox!</p>
            <small>Free bundles in your mail, no spam, no ads, no news, no crap. Promise!</small>
            <input type="submit" value="Subscribe" />
        </fieldset>
    </form>
    <script>
        // prevent submit action
        document.getElementById('subscribe-form').onsubmit = function (e) {
            e.preventDefault();
        }
    </script>
</body>
